        <div className="signIn">
      <div className="loginForm">
        <img className="signUpLogo" src={logo} alt="" />
        <div>
          <input type="email" name="email" id="email" value={email} placeholder="Email" onChange={(e) => { setEmail(e.target.value) }} />
        </div>
        </div>
        </div>
    );
}
